import Content from './content'
class Subscribe extends Component {

    render() {
        return (
            <div className="col-24 sections section-3" style={{background:'#4F3949', padding:'15px 10px'}}>
                <h1 className='titleSubscribe'>WHY SUBSCRIBE TO VIP?</h1>                
                {/* <Content/> */}
            </div>
        )
    }
}

export default Subscribe
